import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

class Square extends React.Component{
    render(){
        return(
            <button className="square">
                {this.props.value}
            </button>
        );
    }
}

class Board extends React.Component{
    rendeSquare(i){
        return<Square value={i}/>
    }

    render(){
        const status = 'Next Player : X';

        return(
            <div>
                <div className="status">{status}</div>
                <div className = "board-row">
                    {this.rendeSquare(0)}
                    {this.rendeSquare(1)}
                    {this.rendeSquare(2)}
                </div>

                <div className = "board-row">
                    {this.rendeSquare(3)}
                    {this.rendeSquare(4)}
                    {this.rendeSquare(5)}
                </div>

                <div className = "board-row">
                    {this.rendeSquare(6)}
                    {this.rendeSquare(7)}
                    {this.rendeSquare(8)}
                </div>
            </div>
        );
    }
}

